import React from 'react';
import Home from './Home';
import {Route, Switch } from 'react-router-dom';


const App = () => {
  return <>
    <Switch>
      <Route path='/' component={Home}/>
      <Route path='/about' component={About}/>
      <Route path='/services' component={Services}/>
      <Route path='' component={Home}/>
     
    </Switch>
  </>;
};
export default App;
